import React from 'react';
import InputSelect from '../InputSelect';
import {
     Container,
     TitleContainer,
     Controllers
 } from './style';

const ContainerHeader: React.FC = () => {
    return (
        <Container>
            <TitleContainer>
                <h1>title</h1>
            </TitleContainer>

            <Controllers>
                <InputSelect />
                <InputSelect />
            </Controllers>
        </Container>
    );
}

export default ContainerHeader;
